Accessing fields for accountName/password<p>I'm working on a simple Spring application for monitoring workouts. I'm using a small MongoDB database for handling my accountName/password/firstName/lastName (basic account info). I'm trying to handle login right now, but I can't seem to figure out how to access the fields correctly to do a simple password check (the data is hosted at mlab.com). </p>

<pre><code>{
"_id": {
    "$oid": "5bdc7952b1c6ac606802ca69"
},
"accountName": "testAccount",
"password": "hockey",
"firstName": "Test",
"lastName": "Tester"
}
</code></pre>

<p>Creating/deleting the account info hasn't been a problem. But I can't seem to figure out how to pull accountName/password fields to do a check against what the user inputs. I've tried using the BasicDBObject and running a query, but it never seems to return anything.</p>

<p>edit:
for example, I've seen examples like this in other threads:</p>

<pre><code>    BasicDBObject query = new BasicDBObject(accountName, "password");
    DBCursor cursor = db.find(query);
</code></pre>

<p>the accountName parameter in my basicDBObject is the account name the user entered. My understanding, which seems to be wrong, is that when I assign a cursor to this query I should be able to get the "password" associated with that accountName in my documents on mlab. I get compiling errors since the return type on my db.find(query) is not a DBCursor.</p>

<p>Here is how my db is declared/accessed:</p>

<pre><code>   private MongoCollection&lt;Document&gt; db;
   MongoClientURI uri  = new MongoClientURI(MONGO_URL);
   MongoClient mongoClient = new MongoClient(uri);
   db = mongoClient.getDatabase(uri.getDatabase()).getCollection(COLLECTION_NAME);
</code></pre>

