How to get matchers work with aggregation for date ranges?<p>I have a model that has author (that is mongoose.Schema.ObjectId), and I have a date field on that model (type Date).</p>

<p>It <strong>works</strong> when I do this, the data comes back:</p>

<pre><code>MyModel.find({
    author: req.user._id,
    started: {
      $gte: start,
      $lte: end
    }
  });
</code></pre>

<p>But I have an aggregation function in my Schema, this is how it looks like:</p>

<pre><code>myModelSchema.statics.getSomeData = function getSomeData(id, start, end) {
  const query = [
    { $sort: { started: 1 } },
    {
      $lookup: {
        from: 'projects',
        localField: 'project',
        foreignField: '_id',
        as: 'projectdata'
      }
    },
    {
      $lookup: {
        from: 'tasks',
        localField: 'task',
        foreignField: '_id',
        as: 'taskdata'
      }
    }
  ];
  if (start &amp;&amp; end) {
    query.unshift({
      $match: {
        $and: [{ started: { $gte: start, $lte: end } }, { author: id }]
      }
    });
  } else {
    query.unshift({ $match: { author: id } });
  }
  return this.aggregate(query);
};
</code></pre>

<p><strong>Note</strong>: The part where I push the matcher for the author, that gets me all the data with the current author <strong>works</strong>, but the part where I also want the data to come back within date range doesn't work, the data comes empty, <strong>when</strong> the start and end dates are passed to the static function.</p>

<p>Date format I pass to the aggregation function: <strong>'2018-11-04 06:00:00'</strong> (a string). </p>

