Mongoose Embedded Document, methods "is not a function"<p>Is there any reason why the process of pushing an EmbeddedDoc into another Document in Mongoose would strip said document of it's methods?</p>

<p>The script I'm using used to work so I'm not sure what has changed. I know they introduced CoreMongooseArray's at some point in version 5 but I've reverted back to an earlier version of 5.0.7 (which uses normal arrays) and the problem still persists.</p>

<p>I have a Cart schema that embeds Cart Items in an array. The cart item schema has various static and instance methods. These are available perfectly up until the moment I push the document into the Cart document.
At that moment the function are no longer accessible and any attempt to call the results in an error message that the function doesn't exist.</p>

<p>Here are the basic schemas:</p>

<p>CART SCHEMA</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>let mongoose = require('mongoose'),
Schema = mongoose.Schema;
let idvalidator = require('mongoose-id-validator');
let CartItemSchema = require('./CartItem');
let PromotionSchema = require('./Promotion');
let _ = require('lodash');

let CartSchema = new Schema({

	  customer_id: {
	  	 type: Schema.Types.ObjectId,
		 ref: 'User'
	  },
	  cartItems: [CartItemSchema],
	  customItems: [],
	  promotionItems: [{type: PromotionSchema, excludeIndexes: true}],
	  quantity: {
        type: Number,
        min: 0,
        required: true,
        default: 0
	  },
      subtotal: {
         type: Number,
         min: 0,
         required: true,
         default: 0
      },
      subtotalWithoutTax:{
          type: Number,
          min: 0,
          required: true,
          default: 0
      },
	  total: {
	  	type: Number,
		min: 0,
		required: true,
		default: 0
	  },
	  totalWithoutTax:{
        type: Number,
        min: 0,
        required: true,
        default: 0
	  }
	},
    {
    	timestamps: true,
		id: false
    }

);

CartSchema.index({ createdAt: 1 }, { expireAfterSeconds: 604800 });

CartSchema.virtual('discount').get(function(){
    return _.round(this.subtotal - this.total, 2);
});

CartSchema.virtual('tax').get(function(){
    return _.round(this.total - this.totalWithoutTax, 2);
});

CartSchema.set('toObject', {virtuals: true});
CartSchema.set('toJSON', {virtuals: true});

CartSchema.plugin(idvalidator);

module.exports = CartSchema;</code></pre>
</div>
</div>
</p>

<p>CART ITEM SCHEMA
<div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>let mongoose = require('mongoose'),
Schema = mongoose.Schema;
let idvalidator = require('mongoose-id-validator');
let SizeSchema = require('./Size');
let ProductExtraSchema = require('./ProductExtra');

let CartItemSchema = new Schema({
	  product_id: {
	  	type: Schema.Types.ObjectId,
		ref: 'Product',
		required: true
	  },
      sku: {
          type: String,
          required: true,
          trim: true,
          lowercase: true
      },
	  name: {
		type: String,
		required: true,
		trim: true
	  },
	  description:  {
		type: String,
		trim: true,
		alias: "desc"
	  },
	  price: {
	  	type: Number,
		min: 0,
		required: true,
		default: 0
	  },
	  priceWithoutTax:{
        type: Number,
        min: 0,
        required: true,
        default: 0
	  },
      total: {
          type: Number,
          min: 0,
          required: true,
          default: 0
      },
      totalWithoutTax:{
          type: Number,
          min: 0,
          required: true,
          default: 0
      },
      taxable: {
          type: Boolean,
          required: true,
          default: false
      },
      taxRate: {
          type: Number,
          required: true,
		  min: 0,
          default: 0.2
      },
	  quantity: {
	  	type: Number,
		min: 1,
		required: true,
		default: 1
	  },
	  size: SizeSchema,
      extras: [ProductExtraSchema]
	},
    {
    	timestamps: true,
		id: false
    }
);


CartItemSchema.set('toObject', {virtuals: true});
CartItemSchema.set('toJSON', {virtuals: true});

CartItemSchema.plugin(idvalidator);

module.exports = CartItemSchema;</code></pre>
</div>
</div>
</p>

<p>These are converted into models in a separate script where the static and instance models are added.</p>

<p>If I then do the following, the methods disappear as soon as the push occurs:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>let CartItem = require('../models/CartItem');
let Cart = require('../models/Cart');

let cartItem = CartItem.hydrate(req.body.cartItem);
let cart = new Cart();
console.log(cartItem.calculateTotals);
cart.cartItems.push(cartItem);
console.log(cart.cartItems[0].calculateTotals);

// Console.logs([Function])
// Console.logs(undefined)</code></pre>
</div>
</div>
</p>

<p>To make matters worse I created a very basic mocha test, which does essentially the same thing and that succeeds. So, what is the difference?
Why is one succeeding where the other doesn't? </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>describe('test', function(){

    it('should allow childs methods to be accessed', function(){

        let childSchema = new Schema({

                name: String

            },
            {
                timestamps: true,
                id: false
            }

        );
        childSchema.methods.hyper = function(){
            console.log("I've eaten too many sweets")
        };


        let parentSchema = new Schema({

                name: String,
                children: [childSchema],

            },
            {
                timestamps: true,
                id: false
            }

        );

       

        let parent = mongoose.model('Parent', parentSchema);
        let child = mongoose.model('Child', childSchema);

        let c = child.hydrate({name: 'Sarah'});
        let p = new parent({name: 'Joe'});

        p.children.push(c);

        for(let c of p.children){
            c.hyper(); 
            // Successfully logs "I've eaten too many sweets"
        }

        return true;

    });

});</code></pre>
</div>
</div>
</p>

